export default (function(a,b,c){return {data:{VOmz2ToOP7:{data:{id:918,attributes:{imdbId:"tt0032420",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjg3NjhkZTEtOWEwZS00MjdjLTg5MmYtOGIxNjlkZmUyNmY3XkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"}],item_lang:{data:{id:1581,attributes:{title:"Drums of Fu Manchu",plot:"The nefarious Dr. Fu Manchu searches for the keys to the tomb of Genghis Khan, in order to fulfill a prophecy that will enable him to conquer the world. His nemesis, Dr. Nayland Smith, and his associates fight to keep the evil doctor from getting his hands on the keys.",slug:"drums-of-fu-manchu"}}},books:{data:[{id:5504,attributes:{title:"The Fu Manchu Omnibus",description:"Contains the stories \"The Island of Fu Manchu\" and \"The Wrath of Fu Manchu.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=o5EaAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2001-01-01",publisher:a,subtitle:"The Island of Fu Manchu; the Wrath of Fu Manchu and Other Stories"}},{id:5505,attributes:{title:"Sax Rohmer's The Drums of Fu Manchu",description:a,thumbnail:a,authors:[b],firstBook:c,published:"1985-01-01",publisher:a,subtitle:a}},{id:5506,attributes:{title:"The Drums of Fu-Manchu",description:"“Imagine a person, tall, lean, and feline, high-shouldered, with a brow like Shakespeare and a face like Satan...” FU-MANCHU EUROPE, 1939—the year before World War II and global chaos. A time of shadows, secret societies, and international conflict. Into this world on the brink comes the most fantastic emissary of evil society has ever known... In order to control the Si-Fan, and then the world, Fu-Manchu must assassinate the dictators who have brought Europe to the brink of war. This places Sir Denis Nayland Smith in the impossible position of defending warmongers who may be as evil as the Devil Doctor himself! ALSO IN THIS VOLUME: A LONG-LOST NAYLAND SMITH SHORT STORY! “Fu Manchu is one of the great villains in pop culture history, insidious and brilliant.”—Christopher Golden, New York Times bestselling co-author of Baltimore: The Plague Ships AFTERWORD BY LESLIE S. KLINGER (THE ANNOTATED SANDMAN by Neil Gaiman)",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=w3O_BgAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2014-06-06",publisher:"Titan Books",subtitle:a}},{id:5507,attributes:{title:"The Fu-Manchu Series Volume One",description:"The adventure-filled novels that introduced the world to the classic supervillain and his criminal organization. The most brilliant criminal the world has ever seen, Fu-Manchu is an expert polyglot and master chemist, adept in the manipulation of the rarest and deadliest poisons. An agent of a secret society bent on controlling the world, his mere gaze is enough to dull the sharpest minds of Great Britain. It is up to police commissioner Nayland Smith and his loyal friend Dr. Petrie to track the devil doctor from the opium dens of the East End to the deserts of Egypt and put an end to his fiendish plans . . . This series, originally written nearly a century ago, has become not only a pop-culture phenomenon—with the character Fu-Manchu appearing in films, on television, on the radio, and in comics—but also the subject of controversies and conversations about attitudes toward Asians at the time, as well as the historical relationship between East and West. This volume includes the first three novels in this wild adventure series: The Insidious Dr. Fu-Manchu, The Return of Dr. Fu-Manchu, and The Hand of Fu-Manchu.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wOMKEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2020-12-01",publisher:"Open Road Media",subtitle:"The Insidious Dr. Fu-Manchu, The Return of Dr. Fu-Manchu, and The Hand of Fu-Manchu"}},{id:5508,attributes:{title:"Bride of Fu Manchu",description:"A strange epidemic is sweeping the Riviera. In desperation the French authorities call upon Dr Petrie to find an answer. During this crisis, a mysterious siren on the beach captivates Alan Sterling. She tells him her name only – Fleurette – and flees. When Petrie's lab cultures show up sleeping sickness and plague, they call in Sir Denis Nayland Smith. It is not long before their investigations lead them to Fleurette – and to Dr Fu Manchu.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-MeWRps9dwgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2009-03-05",publisher:"House of Stratus",subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940959559}}("","Sax Rohmer",null))